const videoApi = () =>{
    var videoData;

    fetch("https://ign-apis.herokuapp.com/videos", {
        mode: 'no-cors',
        method: "GET",
        headers: {
            "Content-Type": "application/json"
        }
    }).then(
        (res)=>res.json()).then((data)=> videoData = data);
    return videoData;
};

export default videoApi;
